import React, { Component } from 'react'

class Sort extends Component {
    constructor(props){
        super (props)
        this.state = {
            sort : ''
        }
    }
    render() {
        return (
            <div className="Sort">
                <div class="dropdown">
                    <button class="btn btn-primary dropdown-toggle" type="button" data-toggle="dropdown">Sort by
                    <span class="caret"></span>
                    </button>
                    <ul class="dropdown-menu">
                        <li><a href="#">Desc</a></li>
                        <li><a href="#">Asc</a></li>
                    </ul>
                </div>
            </div>)
    }
}
export default Sort
